import React from 'react';

function BathroomRemodeling() {
  return (
    <section className="py-20">
      <div className="container mx-auto px-4">
        <h2 className="text-4xl font-bold text-center mb-8">Bathroom Remodeling</h2>
        <img src="https://images.unsplash.com/photo-1598300055817-5b54d6b31f83" alt="Bathroom" className="w-full h-96 object-cover rounded-lg mb-8" />
        <p className="text-lg text-center max-w-2xl mx-auto">
          Create a luxurious spa-like bathroom with elegant fittings, modern vanities, and detailed tile work.
        </p>
      </div>
    </section>
  );
}

export default BathroomRemodeling;
